  return (
  <div className='d-flex justify-content-center align-items-center bg-primary vh-100'>        
    <div className='bg-white p-3 rounded w-25'>           
     <h2>Wellcome to language Learning Portal</h2>                      
          <form>                          
            <Link to="/signup" className='btn btn-default border w-100 bg-light rounded-0 text-decoration-none'>Sign Up</Link>                   
            <p>You are agree to a our terms and policies</p>                
            <Link to="/login" className='btn btn-default border w-100 bg-light rounded-0 text-decoration-none'>Sign in</Link>           
              </form>        
              </div>   
              </div> 
                )}
